import {HashRouter} from 'react-router-dom';
import {renderRoutes} from 'react-router-config';
import routes from '@/router';
import AppHeader from 'components/app-header';
import AppFooter from 'components/app-footer';

function App() {
  return (
    <div className="App">
      <HashRouter>
        <AppHeader />
        {/* Router路由映射，动态渲染组件 */}
        {renderRoutes(routes)}
        <AppFooter />
      </HashRouter>
    </div>
  );
}

export default App;
